import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import CardActionArea from '@material-ui/core/CardActionArea';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Collapse from '@material-ui/core/Collapse';
import Avatar from '@material-ui/core/Avatar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import { red } from '@material-ui/core/colors';
import FavoriteIcon from '@material-ui/icons/Favorite';
import { MailOutline, GitHub, Info, DeveloperMode, Equalizer, Home } from '@material-ui/icons';
import ShareIcon from '@material-ui/icons/Share';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import MoreVertIcon from '@material-ui/icons/MoreVert';

const useStyles = makeStyles({
    root: {
        minWidth: 275,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});

export default ({ result }) => {
    //const classes = useStyles();
    console.log(result)
    return (
        <>
            <Card>
                <CardActionArea>
                    <CardMedia

                        image="/static/images/cards/contemplative-reptile.jpg"
                        title="Contemplative Reptile"
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="h2">
                            {result.domain.raw}
          </Typography>
                        <Typography variant="body2" color="textSecondary" component="p">
                            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                            across all continents except Antarctica
          </Typography>
                    </CardContent>
                </CardActionArea>
                <CardActions disableSpacing>
                    <IconButton aria-label="add to favorites">
                        <MailOutline />
                    </IconButton>
                    <IconButton aria-label="share">
                        <ShareIcon />
                    </IconButton>
                </CardActions>
            </Card>
        <div className="sui-result__header">
            <span
                className="sui-result__title"
                // Snippeted results contain search term highlights with html and are
                // 100% safe and santitized, so we dangerously set them here
                dangerouslySetInnerHTML={{ __html: result.domain.snippet}}
            />
        </div>
        <div className="sui-result__body">
            <div
                className="sui-result__image"
                style={{
                    maxWidth: "140px",
                    paddingLeft: "24px",
                    paddingTop: "10px"
                }}
            >
                <img
                    src={result.domain.raw}
                    alt="thumb"
                    style={{
                        display: "block",
                        width: "100%",
                        height: "100%",
                        objectFit: "cover",
                        objectPosition: "center"
                    }}
                />
            </div>
            <ul className="sui-result__details">
                <li>
                    <span className="sui-result__key">Genre</span>{" "}
                    <span
                        className="sui-result__value"
                        dangerouslySetInnerHTML={{
                            __html: result.domain.snippet
                        }}
                    />
                </li>
                <li>
                    <span className="sui-result__key">Publisher</span>{" "}
                    <span
                        className="sui-result__value"
                        dangerouslySetInnerHTML={{
                            __html: result.domain.snippet
                        }}
                    />
                </li>
                <li>
                    <span className="sui-result__key">Critic Score</span>{" "}
                    <span className="sui-result__value">{result.domain.raw}</span>
                </li>
                <li>
                    <span className="sui-result__key">User Score</span>{" "}
                    <span className="sui-result__value">{result.domain.raw}</span>
                </li>
                <li>
                    <span className="sui-result__key">Platform</span>{" "}
                    <span
                        className="sui-result__value"
                        dangerouslySetInnerHTML={{
                            __html: result.domain.snippet
                        }}
                    />
                </li>
            </ul>
        </div>
        </>
);

                    }
